import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Open cart modal by clicking on the "Cart" div (using text selector as class is generic)
    await page.waitForSelector('text=/\\d+\\s*Cart/', { timeout: 5000 });
    await page.click('text=/\\d+\\s*Cart/');

    // Wait for cart modal to appear by looking for "Your cart is empty" or a cart item
    let cartItemSelector;
    try {
      // Try to find a cart item (image + title)
      cartItemSelector = '.cart-item';
      await page.waitForSelector(cartItemSelector, { timeout: 3000 });
    } catch {
      // If cart is empty, add a product to cart first
      // Close cart modal if open (click outside or ESC)
      await page.keyboard.press('Escape');
      // Click the first "Add to Cart" button on the page (using text and button role)
      await page.waitForSelector('button:has-text("Add to Cart")', { timeout: 5000 });
      await page.click('button:has-text("Add to Cart")');
      // Wait for notification to disappear (if any)
      await page.waitForTimeout(800);
      // Open cart modal again
      await page.click('text=/\\d+\\s*Cart/');
      await page.waitForSelector('.cart-item', { timeout: 5000 });
      cartItemSelector = '.cart-item';
    }

    // Take screenshot of cart before update
    const step2 = path.join(screenshotsDir, 'step_2_cart_before_update.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Find the quantity span inside the first cart item
    const quantitySpan = await page.waitForSelector('.cart-item .cart-item-quantity .quantity', { timeout: 5000 });
    const oldQuantity = await quantitySpan.textContent();

    // Click the "+" button to increase quantity (use :text and nth selector to avoid ambiguity)
    const plusBtn = await page.waitForSelector('.cart-item .cart-item-quantity button:has-text("+")', { timeout: 5000 });
    await plusBtn.click();

    // Wait for quantity to update (value should increment)
    await page.waitForFunction(
      (oldQty) => {
        const qtyEl = document.querySelector('.cart-item .cart-item-quantity .quantity');
        return qtyEl && parseInt(qtyEl.textContent, 10) > parseInt(oldQty, 10);
      },
      oldQuantity,
      { timeout: 3000 }
    );

    // Take screenshot after update
    const step3 = path.join(screenshotsDir, 'step_3_cart_after_update.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Extract updated quantity and cart total
    const newQuantity = await page.$eval('.cart-item .cart-item-quantity .quantity', el => el.textContent.trim());
    const cartTotal = await page.$eval('#cartTotal', el => el.textContent.trim());

    return {
      success: true,
      action: "Updated cart item quantity by increasing it and verified the update",
      extractedData: {
        oldQuantity: oldQuantity.trim(),
        newQuantity,
        cartTotal
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
